import React from 'react';
import styled from 'styled-components'
import {Link} from "react-router-dom";
import Form from "react-bootstrap/Form";

const ButtonConfirm = styled(Link)`
background-color: #002337;
color: white;
border-radius: 2px;

font-weight: 600;
  `

export default () => {
    return (
        <div>
            <div>
                <Form.Group controlId="formBasicName" className="mt-5">
                    <Form.Label>Name:</Form.Label>
                    <Form.Control type="text" placeholder="Edward NjnJdedef" />
                </Form.Group>
                <Form.Group controlId="formBasicEmail">
                    <Form.Label>E-mail:</Form.Label>
                    <Form.Control type="email" placeholder="example@ua.pt" />
                </Form.Group>
                <Form.Group controlId="formBasicPassword">
                    <Form.Label>Password:</Form.Label>
                    <Form.Control type="password" placeholder="Password" />
                </Form.Group>
            </div>
            <div className="mt-5">
                <ButtonConfirm className="p-3" to={"/feed"}>
                    Sign In
                </ButtonConfirm>
            </div>
        </div>
    )
}
